import React, { useState } from 'react';
import Login from './Login';
import './App.css';
import Todolist from './Todolist';

function App() {
  const [loginState, setLoginstate]= useState(false);
  return (
    <div className="App">
      {!loginState && <Login updateState={setLoginstate} />}
      <Todolist />
    </div>
  );
}

export default App;
